import React from 'react';
import { Route } from 'react-router';
import './App.css';
import Header from './component/header';

function App() {
  return (
    <div>
      <Header />
      <Route path="/mylist" component={Mylist}/>
      <Route path="/choose" component={Choose}/>
      <Route path="/three" component={Three}/>
    </div>
  )
}

export default App;
